INSERT INTO `ejercicios` (`idEjercicios`, `Nombre_eje`, `grupo_muscular_idGrupo_Muscular`, `descripcion_eje`, `calorias_quemadas`, `imagen`) VALUES
(15, 'Triceps en polea con barra', 2, ' Presiona la barra suavemente hacia abajo hasta que los brazos estén extendidos completamente. Luego, regresa lentamente a la posición inicial ', 20, );
INSERT INTO `ejercicios` (`idEjercicios`, `Nombre_eje`, `grupo_muscular_idGrupo_Muscular`, `descripcion_eje`, `calorias_quemadas`, `imagen`) VALUES
(23, 'Polea con soga ', 2, 'Colócate frente a la máquina, con los pies a la altura de los hombros.\r\nSujeta firmemente el mango de la polea con las palmas hacia el suelo. Asimismo, debes tener los codos pegados al torso.\r\nRealiza la flexión de los codos hacia el suelo sin perder la postura.\r\nPor otro lado, es importante no empujar hacia abajo la polea con el cuerpo. Solo debes utilizar los antebrazos. De este modo, se ejercitarán los músculos correctos.', 20, );
INSERT INTO `ejercicios` (`idEjercicios`, `Nombre_eje`, `grupo_muscular_idGrupo_Muscular`, `descripcion_eje`, `calorias_quemadas`, `imagen`) VALUES
(25, 'abdominales Cruzados', 8, 'Procede a traer tu codo y hombro derecho, a través de tu cuerpo, al mismo tiempo comenzaras a mover la rodilla izquierda hacia el hombro izquierdo. Asegúrate de intentar tocarte la rodilla con el codo, seguidamente exhala mientras lo vas haciendo.\r\nLuego vuelve a la posición inicial e inhalaras mientras lo vas haciendo, repetirás el movimiento, pero con el codo izquierdo y la rodilla derecha.\r\nSigue alternando esos movimientos, hasta que completes el número de repeticiones.', 10, ),
(34, 'Dominadas agarre neutro', 6, 'Para hacer las dominadas de agarre neutro, la posición inicial es la de sostener las manos enfrentadas en las barras, con los brazos extendidos y la cabeza entre los hombros; las piernas pueden ir completamente estiradas o flexionadas a la altura de la rodilla. Para ayudarse, muchos optan por cruzar los pies.', 5, );
INSERT INTO `ejercicios` (`idEjercicios`, `Nombre_eje`, `grupo_muscular_idGrupo_Muscular`, `descripcion_eje`, `calorias_quemadas`, `imagen`) VALUES
(43, 'Curl de biceps martillo', 39, ' Manteniendo las palmas hacia adentro, levante una de las mancuernas hacia el hombro opuesto hasta sentir la presión sobre el bíceps. Recuerde tener la espalda recta y la mirada hacia adelante.\r\nContinúe el movimiento hasta que la mancuerna toque el hombro y espere unos segundos. Regrese lentamente a la posición inicial.\r\nRepita el mismo movimiento con el brazo contrario y realice el ejercicio hasta completar las repeticiones que desee. ', 2, );
INSERT INTO `ejercicios` (`idEjercicios`, `Nombre_eje`, `grupo_muscular_idGrupo_Muscular`, `descripcion_eje`, `calorias_quemadas`, `imagen`) VALUES
(44, 'Curl de biceps con barra en banco scott', 39, 'Sentados sobre la máquina, apoyamos la totalidad de los brazos sobre el pupitre del banco scott y cogemos una barra Z o dos mancuernas con las manos, de manera que las palmas miren hacia arriba. Sin movilizar los brazos y con los mismos estirados mientras sostenemos el peso, comenzamos el ejercicio.\r\nInspiramos y comenzamos flexionando los codos para llevar las manos hacia el pecho junto al peso, espiramos al final del movimiento y regresamos a la posición inicial lentamente, sin extender comple', 3, );
INSERT INTO `ejercicios` (`idEjercicios`, `Nombre_eje`, `grupo_muscular_idGrupo_Muscular`, `descripcion_eje`, `calorias_quemadas`, `imagen`) VALUES
(45, 'Jalon al pecho agarre prono', 6, '  Inclínate ligeramente hacia atrás (unos 20º aproximadamente), saca pecho y contrae el abdomen. Tira de la barra hacia la parte superior del pecho mientras aprietas los omóplatos. Los codos deben moverse hacia abajo y no hacia atrás.  ', 4, );
INSERT INTO `ejercicios` (`idEjercicios`, `Nombre_eje`, `grupo_muscular_idGrupo_Muscular`, `descripcion_eje`, `calorias_quemadas`, `imagen`) VALUES
(46, 'Peso Muerto con barra', 12, 'Pon la espalda recta y mira hacia adelante en todo momento. La cabeza tiene que estar completamente alineada con la espalda. Para ascender, levanta los hombros y la cadera al mismo tiempo manteniendo la espalda erguida. Una vez has llegado a la posición inicial, vuelve a repetir el movimiento.', 3, );
